import React from 'react';
import TextField from '@material-ui/core/TextField';
import moment from 'moment';

const DateTime =({props , input: { onChange, value }}) =>
	<TextField
		id="date"
		label="Birthday"
		type="date"
		value={!value ? null : new Date(value)}
		InputLabelProps={{
			shrink: true,
		}}
	/>;

export default DateTime;
